(1, 1, 'This is first title for all', '1549116392ea643bacc8236c19df7e850028fc8820.jpg', '<h4><p style=\"box-sizing: border-box; line-height: 1.9; margin: 10px 0px 20px; font-size: 13px; color: rgb(82, 82, 82); font-family: &quot;Whitney SSm A&quot;, &quot;Whitney SSm B&quot;, sans-serif;\">aravel is a web application framework with expressive, elegant syntax. We believe development must be an enjoyable, creative experience to be truly fulfilling. Laravel attempts to take the pain out of development by easing common tasks used in the majority of web projects, such as authentication, routing, sessions, and caching.</p><p style=\"box-sizing: border-box; line-height: 1.9; margin: 10px 0px 20px; font-size: 13px; color: rgb(82, 82, 82); font-family: &quot;Whitney SSm A&quot;, &quot;Whitney SSm B&quot;, sans-serif;\">Laravel aims to make the development process a pleasing one for the developer without sacrificing application functionality. Happy developers make the best code. To this end, we\'ve attempted to combine the very best of what we have seen in other web frameworks, including frameworks implemented in other languages, such as Ruby on Rails, ASP.NET MVC, and Sinatra.</p><p style=\"box-sizing: border-box; line-height: 1.9; margin: 10px 0px 20px; font-size: 13px; color: rgb(82, 82, 82); font-family: &quot;Whitney SSm A&quot;, &quot;Whitney SSm B&quot;, sans-serif;\">Laravel is accessible, yet powerful, providing powerful tools needed for large, robust applications. A superb inversion of control container, expressive migration system, and tightly integrated unit testing support give you the tools you need to build any application with which you are tasked.</p></h4>', 11, 1, 1, '2019-01-26 07:14:43', '2019-02-02 08:07:17'),
(2, 1, '   ', '1549116381BDdMvu4.jpg', '<p style=\"box-sizing: border-box; line-height: 1.9; margin: 10px 0px 20px; font-size: 13px; color: rgb(82, 82, 82); font-family: &quot;Whitney SSm A&quot;, &quot;Whitney SSm B&quot;, sans-serif;\">aravel is a web application framework with expressive, elegant syntax. We believe development must be an enjoyable, creative experience to be truly fulfilling. Laravel attempts to take the pain out of development by easing common tasks used in the majority of web projects, such as authentication, routing, sessions, and caching.</p><p style=\"box-sizing: border-box; line-height: 1.9; margin: 10px 0px 20px; font-size: 13px; color: rgb(82, 82, 82); font-family: &quot;Whitney SSm A&quot;, &quot;Whitney SSm B&quot;, sans-serif;\">Laravel aims to make the development process a pleasing one for the developer without sacrificing application functionality. Happy developers make the best code. To this end, we\'ve attempted to combine the very best of what we have seen in other web frameworks, including frameworks implemented in other languages, such as Ruby on Rails, ASP.NET MVC, and Sinatra.</p><p style=\"box-sizing: border-box; line-height: 1.9; margin: 10px 0px 20px; font-size: 13px; color: rgb(82, 82, 82); font-family: &quot;Whitney SSm A&quot;, &quot;Whitney SSm B&quot;, sans-serif;\">Laravel is accessible, yet powerful, providing powerful tools needed for large, robust applications. A superb inversion of control container, expressive migration system, and tightly integrated unit testing support give you the tools you need to build any application with which you are tasked.</p>', 7, 1, 1, '2019-01-26 14:37:14', '2019-02-02 08:06:21'),
